INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES (1110501, 111011, 1, 0, "", 0, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", 4, 1110501046, 11, 1);
INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES (1110501, 0, "", "", "", "", "", "", 1110501047, 91, "");
